    position: fixed;
    right: 36px;
    top: 36px;
    padding: 20px;
    z-index: 11;

    .fas {
        font-size: 2rem;
        color: $color1;
    }
}

.logo {
    a {
        text-decoration: none;
    }
}

.primary-btn {
    text-decoration: none;
    background: $color1;
    -webkit-border-radius: 30px;
    -moz-border-radius: 30px;
    border-radius: 30px;
    text-align: center;
    color: $color2;
    padding: 15px 30px;
    display: inline-block;
    text-transform: uppercase;
    letter-spacing: 3px;
    transition: $btn-transition;

    &:hover {
        background: $hover;
    }
}

.ghost-btn {
    text-decoration: none;
    border: 4px solid $color1;
    -webkit-border-radius: 30px;
    -moz-border-radius: 30px;
    border-radius: 30px;
    text-align: center;
    color: $color2;
    padding: 12px 27px;
    display: inline-block;
    text-transform: uppercase;
    letter-spacing: 3px;
    transition: $btn-transition;

    &:hover {
        background: $hover;
        border-color: $hover;
    }

}

 .primary-btn{
     margin-right: 20px;
 }

