.resume {
    .info-section{
        width: 20%;
    }
    .content-area {
        background: $color3;
        margin-left: 20%;
        width: 80%;
        min-width: 300px;
        background: white;
        height: 100%;
        overflow: hidden;
        z-index: 1;

        .category {
            margin-bottom: 56px;
            

            h1 {
                font-weight: 700;
                font-size: 2.5rem;
                text-transform: uppercase;
                margin-bottom: 56px;
            }

            .description {
                display: grid;
                grid-template-columns: 1fr 1fr;
                column-gap: 56px;
                row-gap: 30px;
                max-width: 1000px;

                .description-box {
                    padding: 30px;
                    transition: all .3s ease-in-out;
                    cursor: pointer;

                    &:hover {
                        -webkit-box-shadow: 0px 20px 74px 7px rgba(0, 0, 0, 0.12);
                        -moz-box-shadow: 0px 20px 74px 7px rgba(0, 0, 0, 0.12);
                        box-shadow: 0px 20px 74px 7px rgba(0, 0, 0, 0.12);
                    }

                    h5 {
                        font-weight: 500;
                        font-size: 1.3rem;
                        margin-bottom: 1.4rem;
                    }

                    p {
                        font-weight: 300;
                        font-size: 1rem;
                        margin-bottom: .7rem;
                    }
                }
            }
        }

    }
}

